'use strict';
(function () {


    let header = document.getElementById('fixed_header');
    if (!header) {
        header = document.getElementById('fixed_header1');
    }
    window.onscroll = function () {
        console.log(header)
        if (window.scrollY > 10) {
            header.classList.add('header_top_fix');
        } else {
            header.classList.remove('header_top_fix');
        }

    }

})();
